import React, { useEffect, useState } from 'react';
import axios from 'axios';

function AdminGenerateLink() {
  const [temporaryToken, setTemporaryToken] = useState('');
  const [registrationLink, setRegistrationLink] = useState('');

  useEffect(() => {
    async function generateLink() {
      try {
        const response = await axios.post('/admin/generate-link');
        setTemporaryToken(response.data.temporaryToken);
        setRegistrationLink(`/register?tempToken=${response.data.temporaryToken}`);
      } catch (error) {
        console.error(error);
      }
    }

    generateLink();
  }, []);

  return (
    <div>
      <h1>Admin Generate Link</h1>
      <p>Generated Registration Link:</p>
      <a href={registrationLink} target="_blank" rel="noopener noreferrer">
        {registrationLink}
      </a>
    </div>
  );
}

export default AdminGenerateLink;
